import React from 'react'

export default function () {
  return (
    <div>
      <img
        className="img-fluid me-2"
        style={{ height: "1.5em", width: "auto" }}
        src={`${process.env.PUBLIC_URL}/images/Covered.png`}
        alt="logo"
      />
      <h3 className="text-white m-0" aria-current="page">
        Covered
      </h3>
    </div>
  )
}
